export function request(type, page, data) {
  return {
    type,
    payload: { page, data },
  };
}
export function success(type, page, data) {
  return {
    type,
    payload: { page, data },
  };
}
export function failure(type, page, data) {
  return {
    type,
    payload: { page, data },
  };
}
